import React, {Component} from 'react';
import Axios from 'axios';
import {Link} from "react-router-dom";
import {
    BrowserRouter as Router,
    Switch,
    Route,
  } from "react-router-dom";
import logo from '../../images/logo.png';

import "./NavBar.css";

class NavBar extends Component {
    render(){     
        const logout = () => {
            Axios.post("http://localhost:3001/logout", {
            })
        }

        return ( 
            <div>
                <nav className="navBar">
                    <li>
                        <a href='/home' className="options"><Link to="/home"><img className="logoClass" src={logo}/></Link></a> {/* i delete src={logo}*/}
                    </li>
                    <li>
                        <a href='/draft' className="options"><Link to="/draft">Confession Draft</Link></a>
                    </li>
                    <li>
                        <a href='/makeconfession' className="options"><Link to="/makeconfession">Make Confession</Link></a>
                    </li>
                    <li>
                        <a href='/' className="options"><Link to="/" onClick={logout}>Logout</Link></a>
                    </li>
                </nav>
            </div>
        )
    }
}

export default NavBar;
